import styles from './filmCard.module.css';

const FilmCard = ({film}) => {
  return(
    <div className={styles.card}>
      <div className={styles.title}>
        {film.title}
      </div>
      <div className={styles.info}>
        {film.country}, {film.year}
      </div>
      <div className={styles.info}>
        {film.duration} мин
      </div>
    </div>
  )
}

export default FilmCard;
